INSERT INTO `frequest_questions` VALUES (1,'1002','What are the total number of hours that I need to work to be marked present for a full day?','A working day is considered a full day if an employee works for more than 8 hours',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(2,'1003','Are there any minimum number of hours I need to complete to be marked present for half a day?','To avail a half-day leave, the employee is required to work for a minimum period of 4 hours and should intimate the immediate supervisor or the HOD by applying Half Day in System',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(3,'1004','What are the types of leaves (leave ledgers) I am eligible to get?','SEPL follows the All planned leave system. which is inclusive of Paid Leave, Sick Leave, Casual leaves and approved Compensatory off.',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(4,'1005','How do I change my password in HRMS','Passwords can be changed in the My Profile Page. My Profile page is located by navigating the following path: Home > People Tools > Maintain Security > Use > My Profile.When you are in the My Profile page, you will see an option to change your password which reads as, \"Change password\". Click on this link. Type the old password and the new password. Make a note of the new password. Then, click on save, to save the password. If your save is successful, you will be brought back to the General Profile Information screen. Your new password is now in effect.',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(5,'1006','What is the Late Coming Rule?','As per Policy 1 hour late coming is allowed for 3 times in a month, every subsequent late coming is considered as Fine-Rs.100/-',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(6,'1007','What happens to my balance leaves after Resignation','Pending PL are encashed during Full & Final Settlement, SL & CL are lapsed. ',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(7,'1008','Can I avail leaves after resignation?','All Leaves are frozen after you resign,any leaves taken during Notice period will be considered as Leave without pay,C-offs can be used',NULL,0,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(8,'1009','What is the payroll cycle that is followed at SEPL?','1st of a month to 30th or 31st of that month (Eg:- 1-Aug-2017 to 31-Aug-2017)',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(9,'1010','How are leaves calculated?','Privilege leave is calculated for a period of one calendar year (Jan- Dec), 1 day per every 20 physically present days, including weekly-offs and Leaves(CO/CL/PL/SL). ',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(10,'1011','Can I take leave during my probation period?','SEPLdiscourages employees from taking leaves during the first Six months after joining. If an employee has to take a leave during this period, it will be treated as Leave Without Pay. However C-off is applicable for Probation Period.',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(11,'1012','At the end of the year, how many leaves get carried to the next year?','For the subsequent calendar year, an employee is allowed to keep only 30 leaves balance, all other PL\'s are encashed',NULL,1,'2018-12-11 14:58:28','2018-12-11 14:58:28'),(12,'1013','My manager has asked me to work on my week-off due to business reasons. How do I apply for a comp. off.?','Employees required to work on a weekend are eligible for a Comp off in lieu of working on this day, provided it is initiated and approved by HOD. Apply for C-off from Employee Self Service-C-off Request',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(13,'1014','What are the minimum working hours to avail a comp. off.?','A working day is considered a eligible for a comp. off. if an employee works for more than 7 hours',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(14,'1015','What is the sandwich rule that I heard about from my colleagues?','Any Leave except C-off on a Saturday and  Monday will lead to loss of pay for 3 days instead of two days.',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(15,'1016','I am using the HRMS portal for the first time. How do I apply for a leave?','You can login to the system and access the portal user manual for detailed guide',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(16,'1017','What is the difference between Salary and CTC','Any cost born by the employer on behalf of the employee like employer contribution to Provident Fund, Gratuity expense, Insurance expenses etc. over and above the employee\'s salary form part of the total CTC of the employee.',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(17,'1019','How to check my PF balance / passbook','To view provident fund passbook, one may access it here . (https://passbook.epfindia.gov.in/MemberPassBook/Login.jsp) with one\'s UAN and password. ',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(18,'1020','How to link my Aadhar Card with UAN','1- To link your Aadhaar in UAN database, you have to login at UAN member portal. You can login at UAN member portal after the UAN activation2- At the UAN portal dashboard menu, you would see a link to Manage. In the drop-down menu, select KYC.3- You would see a form to update KYC documents. You can update or submit any of the document through this form. Now enter the document number and name as per the document. 4- After the submission of details, your given information is sent to the employer. After the approval by the employer the new KYC document or Aadhaar is added in UAN database.',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(19,'1021','How can I get my LTA Amount','Claim your LTA (if mentioned in your salary letter) by filling LTA requision form and Submit to HR, you will get the amount after 3 months. For more details refer to LTA Policy.',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(20,'1022','How to link the esic Nominee ','On Esic Dash board employee can make the  changes for DOB, Nomine, Address only ',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(21,'1023','I have sent a request for approval (leave, attendance correction etc), but then realized it needs some edits, what do I do?','Request your Manager to Reject the Leave and then reapply ',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(22,'1024','What happens if I forget to apply for leave during a particular month? What is the cut off date by which my leave application should be approved in HRMS?','It will be considered as LWP if you forget to apply leave in HRMS. 1st day of subsequent month of Salary month will be the cut off for applying leaves. ',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29'),(23,'1025','I have applied for leave but my manager has not approved them will my salary be deducted for such unapproved leaves?','If the leave is unapproved till 2nd Day of subsequent month of Salary month will be approved by default by HR',NULL,1,'2018-12-11 14:58:29','2018-12-11 14:58:29');
/*!40000 ALTER TABLE `frequest_questions` ENABLE KEYS */;
UNLOCK TABLES;

