INSERT INTO `thoughts` VALUES (1,'2018-01-01','Wisdom is the reward you get for a lifetime of listening when you\'d have preferred to talk. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(2,'2018-01-02','One of the most sincere forms of respect is actually listening to what another has to say. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(3,'2018-01-03','If you make listening and observation your occupation, you will gain much more than you can by talk. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(4,'2018-01-04','Listening is a magnetic and strange thing, a creative force. The friends who listen to us are the ones we move toward. When we are listened to, it creates us, makes us unfold and expand. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(5,'2018-01-05','Most of the successful people I\'ve known are the ones who do more listening than talking. ','Bernard Baruch ','2018-12-12 07:11:04','2018-12-12 07:11:04'),(6,'2018-01-06','Listening is being able to be changed by the other person. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(7,'2018-01-07','Everything in writing begins with language. Language begins with listening. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(8,'2018-01-08','There is as much wisdom in listening as there is in speaking--and that goes for all relationships, not just romantic ones. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(9,'2018-01-09','The most important thing in communication is hearing what isn\'t said ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(10,'2018-01-10','When people talk, listen completely. Most people never listen. ',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(11,'2018-01-11','Most people do not listen with the intent to understand; they listen with the intent to reply.',NULL,'2018-12-12 07:11:04','2018-12-12 07:11:04'),(12,'2018-01-12','Friends are those rare people who ask how we are, and then wait to hear the answer. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(13,'2018-01-13','The art of conversation lies in listening. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(14,'2018-01-14','You cannot truly listen to anyone and do anything else at the same time. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(15,'2018-01-15','We have two ears and one tongue so that we would listen more and talk less. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(16,'2018-01-16','Stories are a communal currency of humanity. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(17,'2018-01-17','Great stories happen to those who can tell them.  ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(18,'2018-01-18','The engineers of the future will be poets.  ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(19,'2018-01-19','The human species thinks in metaphors and learns through stories. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(20,'2018-01-20','Sometimes reality is too complex. Stories give it form. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(21,'2018-01-21','Story is a yearning meeting an obstacle.  ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(22,'2018-01-22','If you\'re going to have a story, have a big story, or none at all.  ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(23,'2018-01-23','Storytelling reveals meaning without committing the error of defining it. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(24,'2018-01-24','The stories we tell literally make the world. If you want to change the world, you need to change your story. This truth applies both to individuals and institutions. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(25,'2018-01-25','Those who tell the stories rule the world. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(26,'2018-01-26','There is no greater agony than bearing an untold story inside you. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(27,'2018-01-27','There\'s always room for a story that can transport people to another place. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(28,'2018-01-28','Enlightenment is the key to everything, and it is the key to intimacy, because it is the goal of true authenticity. ',NULL,'2018-12-12 07:11:05','2018-12-12 07:11:05'),(29,'2018-01-29','We need to find the courage to say no to the things and people that are not serving us if we want to rediscover ourselves and live our lives with authenticity. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(30,'2018-01-30','I know of nothing more valuable, when it comes to the all-important virtue of authenticity, than simply being who you are.\" --	\n31	31-01-2018	\"The keys to brand success are self-definition, transparency, authenticity and accountability.\" --	\n32	02-02-2018	 \"Hard times arouse an instinctive desire for authenticity.\"--	\n33	03-02-2018	 \"Always be a first-rate version of yourself and not a second-rate version of someone else.\" --	\n34	04-02-2018	 \"Be yourself--not your idea of what you think somebody else\'s idea of yourself should be.\" --	\n35	05-02-2018	\"Shine with all you have. When someone tries to blow you out, just take their oxygen and burn brighter.\" --	\n36	06-02-2018	\"Live authentically. Why would you continue to compromise something that\'s beautiful to create something that is fake?\" --	\n37	07-02-2018	 \"Authentic brands don\'t emerge from marketing cubicles or advertising agencies. They emanate from everything the company does. . .\" --	\n38	08-02-2018	 \"Authenticity requires a certain measure of vulnerability, transparency, and integrity\" --	\n39	09-02-2018	 \"We have to dare to be ourselves, however frightening or strange that self may prove to be.\" --	\n40	10-02-2018	 \"If you trade your authenticity for safety, you may experience the following: anxiety, depression, eating disorders, addiction, rage, blame, resentment, and inexplicable grief.\" -	\n41	11-02-2018	 \"I can be a better me than anyone can.\" -	\n42	12-02-2018	 \"There is no persuasiveness more effectual than the transparency of a single heart, of a sincere life.\" --	\n43	13-02-2018	\"Transparency, honesty, kindness, good stewardship, even humor, work in businesses at all times.\" --	\n44	14-02-2018	\"A lack of transparency results in distrust and a deep sense of insecurity.',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(31,'2018-02-15','I love when things are transparent, free and clear of all inhibition and judgment.\" --	\n46	16-02-2018	 \"Eyes so transparent that through them the soul is seen.\" --	\n47	17-02-2018	\"Transparency is not the same as looking straight through a building: it\'s not just a physical idea, it\'s also an intellectual one.\" --	\n48	18-02-2018	 \"I wish that every human life might be pure transparent freedom.\" --	\n49	19-02-2018	 \"Truth never damages a cause that is just. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(32,'2018-02-20','He had shown her all the workings of his soul, mistaking this for love. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(33,'2018-02-21','Our whole philosophy is one of transparency. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(34,'2018-02-22','A basic tenet of healthy democracy is open dialogue and transparency',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(35,'2018-02-23','I just think we need more accountability and more transparency. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(36,'2018-02-24','Honesty is the first chapter in the book of wisdom. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(37,'2018-02-25','Individual commitment to a group effort--that is what makes a team work, a company work, a society work, a civilization work. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(38,'2018-02-26','Talent wins games, but teamwork and intelligence wins championships. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(39,'2018-02-27','Teamwork is the ability to work together toward a common vision. The ability to direct individual accomplishments toward organizational objectives. It is the fuel that allows common people to attain uncommon results. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(40,'2018-02-28','Alone we can do so little, together we can do so much. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(41,'2018-03-01','Remember teamwork begins by building trust. And the only way to do that is to overcome our need for invulnerability. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(42,'2018-03-02','I invite everyone to choose forgiveness rather than division, teamwork over personal ambition. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(43,'2018-03-03','None of us is as smart as all of us. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(44,'2018-03-04','Coming together is a beginning. Keeping together is progress. Working together is success. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(45,'2018-03-05','If everyone is moving forward together, then success takes care of itself. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(46,'2018-03-06','The strength of the team is each individual member. The strength of each member is the team. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(47,'2018-03-07','Collaboration allows teachers to capture each other\'s fund of collective intelligence. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(48,'2018-03-08','It takes two flints to make a fire. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(49,'2018-03-09','Unity is strength. . . when there is teamwork and collaboration, wonderful things can be achieved. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(50,'2018-03-10','To me, teamwork is the beauty of our sport, where you have five acting as one. You become selfless. ',NULL,'2018-12-12 07:11:06','2018-12-12 07:11:06'),(51,'2018-03-11','The best teamwork comes from men who are working independently toward one goal in unison. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(52,'2018-03-12','I think that if you keep your eyes and your ears open and you are receptive to learning, there are skills you can get from any job at all.',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(53,'2018-03-13','Seeking means: to have a goal; but finding means: to be free, to be receptive, to have no goal.',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(54,'2018-03-14','It is impossible to withhold education from the receptive mind, as it is impossible to force it upon the unreasoning. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(55,'2018-03-15','One of the things I\'ve learned is to be receptive of feedback. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(56,'2018-03-16','The best way to persuade people is with your ears--by listening to them.  ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(57,'2018-03-17','Confidence, like art, never comes from having all the answers; it comes from being open to all the questions. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(58,'2018-03-18','Life is 10% what happens to me and 90% how I react. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(59,'2018-03-19','The pessimist complains about the wind; the optimist expects it to change; the realist adjusts the sails. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(60,'2018-03-20','Relax & clear your mind if someone is speaking, so that you\'re receptive to what they\'re saying.',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(61,'2018-03-21','The most difficult thing is the decision to act, the rest is merely tenacity.',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(62,'2018-03-22','Either you run the day, or they day runs you',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(63,'2018-03-23','Tactics, fitness, stroke ability, adaptability, experience, and sportsmanship are all necessary for winning. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(64,'2018-03-24','It is not the strongest or the most intelligent who will survive but those who can best manage change. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(65,'2018-03-25','Adaptability is about the powerful difference between adapting to cope and adapting to win. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(66,'2018-03-26','The art of life is a constant readjustment to our surroundings. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(67,'2018-03-27','Adaptability is not imitation. It means power of resistance and assimilation.',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(68,'2018-03-28','You can\'t build an adaptable organization without adaptable people- and individuals change only when they have to, or when they want to. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(69,'2018-03-29','People will try to tell you that all the great opportunities have been snapped up. In reality, the world changes every second, blowing new opportunities in all directions, including yours. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(70,'2018-03-30','Learn to adjust yourself to the conditions you have to endure, but make a point of trying to alter or correct conditions so that they are most favorable to you. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(71,'2018-03-31','All fixed set patterns are incapable of adaptability or pliability. The truth is outside of all fixed patterns. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(72,'2018-04-01','A wise man adapts himself to circumstances, as water shapes itself to the vessel that contains it. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(73,'2018-04-02','Fall seven times and stand up eight. ',NULL,'2018-12-12 07:11:07','2018-12-12 07:11:07'),(74,'2018-04-03','When I let go of what I am, I become what I might be.',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(75,'2018-04-04','You can\'t fall if you don\'t climb. But there\'s no joy in living your whole life on the ground.',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(76,'2018-04-05','Every great dream begins with a dreamer. Always remember, you have within you the strength, the patience, and the passion to reach for the stars to change the world. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(77,'2018-04-06','There is no passion to be found playing small--in settling for a life that is less than the one you are capable of living. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(78,'2018-04-07','Develop a passion for learning. If you do, you will never cease to grow. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(79,'2018-04-08','Passion is energy. Feel the power that comes from focusing on what excites you. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(80,'2018-04-09','If passion drives you, let reason hold the reins. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(81,'2018-04-10','We must act out passion before we can feel it. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(82,'2018-04-11','It is obvious that we can no more explain a passion to a person who has never experienced it than we can explain light to the blind.',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(83,'2018-04-12','Nothing is as important as passion. No matter what you want to do with your life, be passionate. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(84,'2018-04-13','You can\'t fake passion. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(85,'2018-04-14','You have to be burning with \"an idea, or a problem, or a wrong that you want to right.\" If you\'re not passionate enough from the start, you\'ll never stick it out. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(86,'2018-04-15','Yes, in all my research, the greatest leaders looked inward and were able to tell a good story with authenticity and passion. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(87,'2018-04-16','If you feel like there\'s something out there that you\'re supposed to be doing, if you have a passion for it, then stop wishing and just do it. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(88,'2018-04-17','If you don\'t love what you do, you won\'t do it with much conviction or passion. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(89,'2018-04-18','There is no end. There is no beginning. There is only the passion of life. There is no end. There is no beginning. There is only the passion of life. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(90,'2018-04-19','Any guy that\'s not working with the same amount of intensity and passion that I do, I don\'t want to know. ',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(91,'2018-04-20','It is the soul\'s duty to be loyal to its own desires. It must abandon itself to its master passion. 	\n110	21-04-2018	The way get started is to quit talking and begin doing. 	\n111	22-04-2018	\"The pessimist sees difficulty in every opportunity. The optimist sees opportunity in every difficulty. 	\n112	23-04-2018	Dont let yesterday take up too much of today. 	\n113	24-04-2018	\"The husband who decides to surprise his wife is often very much surprised himself.',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(92,'2018-04-25','Never tell people how to do things. Tell them what to do and they will surprise you with their ingenuity.',NULL,'2018-12-12 07:11:08','2018-12-12 07:11:08'),(93,'2018-04-26','A story to me means a plot where there is some surprise. Because that is how life is--full of surprises.',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(94,'2018-04-27','Truth is so rare that it is delightful to tell it.',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(95,'2018-04-28','It doesn\'t take much to surprise others, but to surprise oneself- now that is a great feat.',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(96,'2018-04-29','Surprise yourself every day with your own courage.',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(97,'2018-04-30','To the issues of friendship, love, business and war, \"surprise\" is the optimistic solution.',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(98,'2018-05-01','Never tell people how to do things. Tell them what to do and they will surprise you with their ingenuity. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(99,'2018-05-02','A story to me means a plot where there is some surprise. Because that is how life is--full of surprises. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(100,'2018-05-03','People tend to play in their comfort zone, so the best things are achieved in a state of surprise, actually. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(101,'2018-05-04','Simplicity is the ultimate sophistication. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(102,'2018-05-05','There is no greatness where there is no simplicity, goodness and truth. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(103,'2018-05-06','Manifest plainness, embrace simplicity, reduce selfishness, have few desires. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(104,'2018-05-07','Simplicity and repose are the qualities that measure the true value of any work of art. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(105,'2018-05-08','Simplicity is the most difficult thing to secure in this world; it is the last limit of experience and the last effort of genius. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(106,'2018-05-09','There is a certain majesty in simplicity which is far above all the quaintness of wit. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(107,'2018-05-10','Simplicity is not the goal. It is the by-product of a good idea and modest expectations. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(108,'2018-05-11','Simplicity is prerequisite for reliability. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(109,'2018-05-12','Simplicity, clarity, singleness: These are the attributes that give our lives power and vividness and joy as they are also the marks of great art. They seem to be the purpose of God for his whole creation. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(110,'2018-05-13','If you haven\'t done much giving in your life-try it and see how you feel afterwards. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(111,'2018-05-14','If you can\'t explain it to a six year old, you don\'t understand it yourself. ',NULL,'2018-12-12 07:11:09','2018-12-12 07:11:09'),(112,'2018-05-15','Life is really simple, but we insist on making it complicated.',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(113,'2018-05-16',' Simplicity is about subtracting the obvious and adding the meaningful.\" ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(114,'2018-05-17','Free yourself from the complexities of your life! A life of simplicity and happiness awaits you.',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(115,'2018-05-18','Nature is pleased with simplicity. And nature is no dummy ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(116,'2018-05-19','If you will stay close to nature, to its simplicity, to the small things hardly noticeable, those things can unexpectedly become great and immeasurable. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(117,'2018-05-20','Reflect upon your present blessings--of which every man has many--not on your past misfortunes, of which all men have some. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(118,'2018-05-21','The truest indication of gratitude is to return what you are grateful for. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(119,'2018-05-22','I work very hard, and I play very hard. I\'m grateful for life. And I live it--I believe life loves the liver of it. I live it. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(120,'2018-05-23','When you are grateful--when you can see what you have--you unlock blessings to flow in your life.',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(121,'2018-05-24','We must find time to stop and thank the people who make a difference in our lives. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(122,'2018-05-25','True forgiveness is when you can say, \"Thank you for that experience. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(123,'2018-05-26','You can complain because roses have thorns, or you can be grateful that thorn bushes have roses. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(124,'2018-05-27','Do not spoil what you have by desiring what you have not; remember that what you now have was once among the things you only hoped for. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(125,'2018-05-28','Cultivate the habit of being grateful for every good thing that comes to you, and to give thanks continuously. And because all things have contributed to your advancement, you should include all things in your gratitude. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(126,'2018-05-29','10. \"Let gratitude be the pillow upon which you kneel to say your nightly prayer. And let faith be the bridge you build to overcome evil and welcome good.\"',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(127,'2018-05-30','We can only be said to be alive in those moments when our hearts are conscious of our treasures. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(128,'2018-05-31','As we express our gratitude, we must never forget that the highest appreciation is not to utter words, but to live by them. ',NULL,'2018-12-12 07:11:10','2018-12-12 07:11:10'),(129,'2018-06-01','Gratitude is not only the greatest of virtues, but the parent of all others. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(130,'2018-06-02','Those who have the ability to be grateful are the ones who have the ability to achieve greatness. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(131,'2018-06-03','This is my simple religion. There is no need for temples; no need for complicated philosophy. Our own brain, our own heart is our temple; the philosophy is kindness. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(132,'2018-06-04','A warm smile is the universal language of kindness. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(133,'2018-06-05','Truth is a deep kindness that teaches us to be content in our everyday life and share with the people the same happiness. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(134,'2018-06-06','There is overwhelming evidence that the higher the level of self-esteem, the more likely one will be to treat others with respect, kindness, and generosity. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(135,'2018-06-07','Wherever there is a human being, there is an opportunity for a kindness. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(136,'2018-06-08','Treat everyone with respect and kindness. Period. No exceptions. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(137,'2018-06-09','Be kind, for everyone you meet is fighting a harder battle.',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(138,'2018-06-10','Kindness is a language which the deaf can hear and the blind can see. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(139,'2018-06-11','The smallest act of kindness is worth more than the greatest intention. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(140,'2018-06-12','I would rather make mistakes in kindness and compassion than work miracles in unkindness and hardness. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(141,'2018-06-13','Never lose a chance of saying a kind word.  ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(142,'2018-06-14','Our kindness may be the most persuasive argument for that which we believe. ',NULL,'2018-12-12 07:11:11','2018-12-12 07:11:11'),(143,'2018-06-15','It\'s a little embarrassing that after 45 years of research & study, the best advice I can give people is to be a little kinder to each other. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(144,'2018-06-16','It seems to me that no matter what religion you subscribe to, acts of kindness are the stepping-stones to making the world a better place--because we become better people in it. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(145,'2018-06-17','Never look down on anybody unless you\'re helping them up. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(146,'2018-06-18','Humility is not thinking less of yourself, it\'s thinking of yourself less. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(147,'2018-06-19','Pride makes us artificial and humility makes us real. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(148,'2018-06-20','Thank you\' is the best prayer that anyone could say. I say that one a lot. Thank you expresses extreme gratitude, humility, understanding. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(149,'2018-06-21','The greatest friend of truth is Time, her greatest enemy is Prejudice, and her constant companion is Humility. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(150,'2018-06-22','The proud man can learn humility, but he will be proud of it. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(151,'2018-06-23','Real genius is nothing else but the supernatural virtue of humility in the domain of thought. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(152,'2018-06-24','Humility is really important because it keeps you fresh and new. ',NULL,'2018-12-12 07:11:12','2018-12-12 07:11:12'),(153,'2018-06-25','Humility, that low, sweet root, from which all heavenly virtues shoot. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(154,'2018-06-26','Humility is throwing oneself away in complete concentration on something or someone else. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(155,'2018-06-27','Pride must die in you, or nothing of heaven can live in you. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(156,'2018-06-28','Humility is nothing but truth, and pride is nothing but lying. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(157,'2018-06-29','One cannot be humble and aware of oneself at the same time. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(158,'2018-06-30','Selflessness is humility. Humility and freedom go hand in hand. Only a humble person can be free. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(159,'2018-07-01','Have more humility. Remember you don\'t know the limits of your own abilities. Successful or not, if you keep pushing beyond yourself, you will enrich your own life--and maybe even please a few strangers. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(160,'2018-07-02','No one has ever become poor by giving. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(161,'2018-07-03','A kind gesture can reach a wound that only compassion can heal. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(162,'2018-07-04','Simplicity is the keynote of all true Elegance','Coco Chanel','2018-12-12 07:11:13','2018-12-12 07:11:13'),(163,'2018-07-05','As we work to create light for others, we naturally light our own way. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(164,'2018-07-06','Until we can receive with an open heart, we\'re never really giving with an open heart. When we attach judgment to receiving help, we knowingly or unknowingly attach judgment to giving help.\" ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(165,'2018-07-07','Even the smallest act of caring for another person is like a drop of water -it will make ripples throughout the entire pond... ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(166,'2018-07-08','Don\'t wait for other people to be loving, giving, compassionate, grateful, forgiving, generous, or friendly... lead the way! ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(167,'2018-07-09','What we spend, we lose. What we keep will be left for others. What we give away will be ours forever. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(168,'2018-07-10','There is a very real relationship, both quantitatively and qualitatively, between what you contribute and what you get out of this world. ',NULL,'2018-12-12 07:11:13','2018-12-12 07:11:13'),(169,'2018-07-11','When in doubt as to what you should do, err on the side of giving.',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(170,'2018-07-12','I wish I were like Facebook; being able to \'like\' and \'share\' everything I get. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(171,'2018-07-13','Just like downing a powerful caffeine drink, \"reaching out to others\" pays that big \"life energizer dividend! ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(172,'2018-07-14','Every sunrise is an invitation for us to arise and brighten someone\'s day. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(173,'2018-07-15','Nothing in the world can take the place of persistence. Talent will not; nothing is more common than unsuccessful men with talent. Genius will not; unrewarded genius is almost a proverb. Education will not; the world is full of educated derelicts. Persistence and determination alone are omnipotent.\" -Calvin Coolidge	\n196	16-07-2018	 \"Energy and persistence conquer all things. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(174,'2018-07-17','As long as we are persistence in our pursuit of our deepest destiny, we will continue to grow. We cannot choose the day or time when we will fully bloom. It happens in its own time. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(175,'2018-07-18','Success is almost totally dependent upon drive and persistence. The extra energy required to make another effort or try another approach is the secret of winning. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(176,'2018-07-19','Never let your persistence and passion turn into stubbornness and ignorance. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(177,'2018-07-20','The difference between people who believe they have books inside of them and those who actually write books is sheer cussed persistence--the ability to make yourself work at your craft, every day--the belief, even in the face of obstacles, that you\'ve got something worth saying.\" -Jennifer Weiner	\n201	21-07-2018	\"When I meet successful people I ask 100 questions as to what they attribute their success to. It is usually the same: persistence, hard work and hiring good people. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(178,'2018-07-22','Success is stumbling from failure to failure with no loss of enthusiasm. ',NULL,'2018-12-12 07:11:14','2018-12-12 07:11:14'),(179,'2018-07-23','The best way out is always through. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(180,'2018-07-24','If you have an important point to make, don\'t try to be subtle or clever. Use a pile driver. Hit the point once. Then come back and hit it again. Then hit it a third time--a tremendous whack. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(181,'2018-07-25','Knowing trees, I understand the meaning of patience. Knowing grass, I can appreciate persistence. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(182,'2018-07-26','Character consists of what you do on the third and fourth tries. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(183,'2018-07-27','Keep a little fire burning; however small, however hidden.\" \"Keep a little fire burning; however small, however hidden. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(184,'2018-07-28','No matter how much falls on us, we keep plowing ahead. That\'s the only way to keep the roads clear. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(185,'2018-07-29','If you wish to be out front, then act as if you were behind. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(186,'2018-07-30','The slogans \"hang on\" and \"press on\" have solved and will continue to solve the problems of humanity. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(187,'2018-07-31','It is during our darkest moments that we must focus to see the light. ',NULL,'2018-12-12 07:11:15','2018-12-12 07:11:15'),(188,'2018-08-01','You never have to change anything you got up in the middle of the 