ed. ',NULL,'2018-12-12 07:11:16','2018-12-12 07:11:16'),(202,'2018-08-15','Go confidently in the direction of your dreams. Live the life you have imagined.',NULL,'2018-12-12 07:11:16','2018-12-12 07:11:16'),(203,'2018-08-16','Only a life lived for others is a life worthwhile. ',NULL,'2018-12-12 07:11:16','2018-12-12 07:11:16'),(204,'2018-08-17','Change is the law of life. And those who look only to the past or present are certain to miss the future. ',NULL,'2018-12-12 07:11:16','2018-12-12 07:11:16'),(205,'2018-08-18','Life is a succession of lessons which must be lived to be understood. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(206,'2018-08-19','The price of anything is the amount of life you exchange for it. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(207,'2018-08-20','Life is far too important a thing ever to talk seriously about. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(208,'2018-08-21','Don\'t let life discourage you; everyone who got where he is had to begin where he was. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(209,'2018-08-22','The only disability in life is a bad attitude. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(210,'2018-08-23','Every creature is better alive than dead, men and moose and pine trees, and he who understands it aright will rather preserve its life than destroy it. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(211,'2018-08-24','Don\'t let life discourage you; everyone who got where he is had to begin where he was. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(212,'2018-08-25','Not life, but good life, is to be chiefly valued. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(213,'2018-08-26','If you live long enough, you\'ll make mistakes. But if you learn from them, you\'ll be a better person. It\'s how you handle adversity, not how it affects you. The main thing is never quit, never quit, never quit. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(214,'2018-08-27','Life in abundance comes only through great love. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(215,'2018-08-28','Love is not maximum emotion. Love is maximum commitment. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(216,'2018-08-29','Although love is communicated in a number of ways,our words often reflect the condition of our heart. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(217,'2018-08-30','Keep love in your heart. A life without it is like a sunless garden when the flowers are dead. ',NULL,'2018-12-12 07:11:17','2018-12-12 07:11:17'),(218,'2018-08-31','Sometimes the heart sees what is invisible to the eye. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(219,'2018-09-01','I have decided to stick with love. Hate is too great a burden to bear. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(220,'2018-09-02','Where there is love there is life. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(221,'2018-09-03','Let us always meet each other with smile, for the smile is the beginning of love.',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(222,'2018-09-04','A loving heart is the beginning of all knowledge. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(223,'2018-09-05','Love begins at home, and it is not how much we do... but how much love we put in that action. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(224,'2018-09-06','A flower cannot blossom without sunshine, and man cannot live without love. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(225,'2018-09-07','We love life, not because we are used to living but because we are used to loving. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(226,'2018-09-08','Love yourself first and everything else falls into line. You really have to love yourself to get anything done in this world. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(227,'2018-09-09','Love is a better teacher than duty.',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(228,'2018-09-10','The best proof of love is trust. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(229,'2018-09-11','Love is life. And if you miss love, you miss life. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(230,'2018-09-12','Faith makes all things possible... love makes all things easy. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(231,'2018-09-13','Change is hardest at the beginning, messiest in the middle and best at the end. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(232,'2018-09-14','Be the change that you wish to see in the world. ',NULL,'2018-12-12 07:11:18','2018-12-12 07:11:18'),(233,'2018-09-15','Things change. And friends leave. Life doesn\'t stop for anybody. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(234,'2018-09-16','Never doubt that a small group of thoughtful, committed, citizens can change the world. Indeed, it is the only thing that ever has.\" -	\n259	17-09-2018	 \"Everyone thinks of changing the world, but no one thinks of changing himself. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(235,'2018-09-18','Education is the most powerful weapon which you can use to change the world. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(236,'2018-09-19','Change will not come if we wait for some other person, or if we wait for some other time. We are the ones we\'ve been waiting for. We are the change that we seek. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(237,'2018-09-20','They always say time changes things, but you actually have to change them yourself. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(238,'2018-09-21','We are taught you must blame your father, your sisters, your brothers, the school, the teachers--but never blame yourself. It\'s never your fault. But it\'s always your fault, because if you wanted to change you\'re the one who has got to change. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(239,'2018-09-22','Change the way you look at things and the things you look at change. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(240,'2018-09-23','No matter who you are, no matter what you did, no matter where you\'ve come from, you can always change, become a better version of yourself. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(241,'2018-09-24','Those who cannot change their minds cannot change anything. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(242,'2018-09-25','I alone cannot change the world, but I can cast a stone across the waters to create many ripples. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(243,'2018-09-26','Change is the end result of all true learning. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(244,'2018-09-27','To improve is to change; to be perfect is to change often. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(245,'2018-09-28','Life belongs to the living, and he who lives must be prepared for changes ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(246,'2018-09-29','If you want to change the world, pick up your pen and write. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(247,'2018-09-30','A tiny change today brings a dramatically different tomorrow. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(248,'2018-10-01','Change your thoughts and you change your world. ',NULL,'2018-12-12 07:11:19','2018-12-12 07:11:19'),(249,'2018-10-02','Forgiveness does not change the past, but it does enlarge the future ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(250,'2018-10-03','Some people believe holding on and hanging in there are signs of great strength. However, there are times when it takes much more strength to know when to let go and then do it. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(251,'2018-10-04','The beautiful journey of today can only begin when we learn to let go of yesterday. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(252,'2018-10-05','Thank God I found the GOOD in goodbye ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(253,'2018-10-06','The weak can never forgive. Forgiveness is the attribute of the strong.',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(254,'2018-10-07','Always forgive your enemies--nothing annoys them so much. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(255,'2018-10-08','Forgiveness is the fragrance that the violet sheds on the heel that has crushed it. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(256,'2018-10-09','When you forgive, you in no way change the past--but you sure do change the future. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(257,'2018-10-10','People can be more forgiving than you can imagine. But you have to forgive yourself. Let go of what\'s bitter and move on. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(258,'2018-10-11','To err is human; to forgive, divine. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(259,'2018-10-12','There is no love without forgiveness, and there is no forgiveness without love.',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(260,'2018-10-13','Forgiveness is a funny thing. It warms the heart and cools the sting. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(261,'2018-10-14','It takes one person to forgive, it takes two people to be reunited. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(262,'2018-10-15','Forgiveness is a gift you give yourself. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(263,'2018-10-16','Without forgiveness, there\'s no future. ',NULL,'2018-12-12 07:11:20','2018-12-12 07:11:20'),(264,'2018-10-17','Sooner or later we\'ve all got to let go of our past. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(265,'2018-10-18','Yesterday is not ours to recover, but tomorrow is ours to win or lose. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(266,'2018-10-19','The great courageous act that we must all do, is to have the courage to step out of our history and past so that we can live our dreams. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(267,'2018-10-20','I\'ve learned through the years that it\'s not where you live, it\'s the people who surround you that make you feel at home. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(268,'2018-10-21','The love of family and the admiration of friends is much more important than wealth and privilege. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(269,'2018-10-22','Family is not an important thing. It\'s everything. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(270,'2018-10-23','Family is the most important thing in the world. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(271,'2018-10-24','A happy family is but an earlier heaven. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(272,'2018-10-25','A man should never neglect his family for business. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(273,'2018-10-26','To us, family means putting your arms around each other and being there. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(274,'2018-10-27','Without a family, man, alone in the world, trembles with the cold. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(275,'2018-10-28','Cherish your human connections--your relationships with friends and family. ',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(276,'2018-10-29','In every conceivable manner, the family is link to our past, bridge to our future.',NULL,'2018-12-12 07:11:21','2018-12-12 07:11:21'),(277,'2018-10-30','The family is one of nature\'s masterpieces. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(278,'2018-10-31','. \"The family is the first essential cell of human society.\" ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(279,'2018-11-01','Family means no one gets left behind or forgotten. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(280,'2018-11-02','A man travels the world over in search of what he needs, and returns home to find it. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(281,'2018-11-03','I sustain myself with the love of family. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(282,'2018-11-04','Home is where you are loved the most and act the worst. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(283,'2018-11-05','You are born into your family and your family is born into you. No returns. No exchanges. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(284,'2018-11-06','Home is people. Not a place. If you go back there after the people are gone, then all you can see is what is not there any more. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(285,'2018-11-07','That which does not kill us makes us stronger. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(286,'2018-11-08','We are only as strong as we are united, as weak as we are divided. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(287,'2018-11-09','Courage is the most important of all the virtues because without courage, you can\'t practice any other virtue consistently. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(288,'2018-11-10','A brave man acknowledges the strength of others. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(289,'2018-11-11','Strength does not come from physical capacity. It comes from an indomitable will. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(290,'2018-11-12','It is easier to build strong children than to repair broken men. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(291,'2018-11-13','With the new day comes new strength and new thoughts. ',NULL,'2018-12-12 07:11:22','2018-12-12 07:11:22'),(292,'2018-11-14','The world breaks every one and afterward many are strong at the broken places. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(293,'2018-11-15','Be strong. Live honorably and with dignity. When you don\'t think you can, hold on. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(294,'2018-11-16','You feel your strength in the experience of pain. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(295,'2018-11-17','My attitude is that if you push me towards something that you think is a weakness, then I will turn that perceived weakness into a strength. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(296,'2018-11-18','Its not always necessary to be strong, but to feel strong. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(297,'2018-11-19','We acquire the strength we have overcome. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(298,'2018-11-20','Mastering others is strength. Mastering oneself makes you fearless. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(299,'2018-11-21','We gain strength, and courage, and confidence by each experience in which we really stop to look fear in the face... we must do that which we think we cannot. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(300,'2018-11-22','Character cannot be developed in ease and quiet. Only through experience of trial and suffering can the soul be strengthened, ambition inspired, and success achieved. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(301,'2018-11-23','Shallow men believe in luck. Strong men believe in cause and effect. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(302,'2018-11-24','Leadership is service, not position. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(303,'2018-11-25','A leader is a dealer in hope. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(304,'2018-11-26','A leader is one who knows the way, goes the way, and shows the way. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(305,'2018-11-27','No man will make a great leader who wants to do it all himself, or to get all the credit for doing it. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(306,'2018-11-28','As we look ahead into the next century, leaders will be those who empower others. ',NULL,'2018-12-12 07:11:23','2018-12-12 07:11:23'),(307,'2018-11-29','A genuine leader is not a searcher for consensus but a molder of consensus.',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(308,'2018-11-30','Effective leadership is not about making speeches or being liked; leadership is defined by results not attributes. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(309,'2018-12-01','Innovation distinguishes between a leader and a follower. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(310,'2018-12-02','Be the chief but never the lord. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(311,'2018-12-03','The speed of the team is the speed of the boss. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(312,'2018-12-04','Leaders think and talk about the solutions. Followers think and talk about the problems. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(313,'2018-12-05','Leadership and learning are indispensable to each other. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(314,'2018-12-06','To handle yourself, use your head; to handle others, use your heart. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(315,'2018-12-07','Management is nothing more than motivating other people. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(316,'2018-12-08','Management is efficiency in climbing the ladder of success; leadership determines whether the ladder is leaning against the right wall. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(317,'2018-12-09','The price of greatness is responsibility. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(318,'2018-12-10','The key to successful leadership today is influence, not authority. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(319,'2018-12-11','Create with the heart; build with the mind. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(320,'2018-12-12','No legacy is so rich as honesty. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(321,'2018-12-13','Carve your name on hearts, not tombstones. A legacy is etched into the minds of others and the stories they share about you. ',NULL,'2018-12-12 07:11:24','2018-12-12 07:11:24'),(322,'2018-12-14','If you would not be forgotten as soon as you are dead, either write something worth reading or do something worth writing. ',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(323,'2018-12-15','The things you do for yourself are gone when you are gone, but the things you do for others remain as your legacy. ',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(324,'2018-12-16','The only thing you take with you when you\'re gone is what you leave behind. ',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(325,'2018-12-17','I agree with you entirely in condemning the mania of giving names to objects of any kind after persons still living. Death alone can seal the title of any man to this honor, by putting it out of his power to forfeit it.',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(326,'2018-12-18','The greatest use of life is to spend it for something that will outlast it. ',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(327,'2018-12-19','You can\'t leave a footprint that lasts if you\'re always walking on tiptoe. ',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(328,'2018-12-20','If you succumb to the temptation of using violence in the struggle, unborn generations will be the recipients of a long and desolate night of bitterness, and your chief legacy to the future will be an endless reign of meaningless chaos. ',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(329,'2018-12-21','Whatever the mind of man can conceive and believe, it can achieve.',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(330,'2018-12-22','Strive not to be a success, but rather to be of value.',NULL,'2018-12-12 07:11:25','2018-12-12 07:11:25'),(331,'2018-12-23','Two roads diverged in a wood, and II took the one less traveled by, And that has made all the difference.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(332,'2018-12-24','I attribute my success to this: I never gave or took any excuse.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(333,'2018-12-25','You miss 100% of the shots you dont take.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(334,'2018-12-26','The most difficult thing is the decision to act, the rest is merely tenacity.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(335,'2018-12-27','Every strike brings me closer to the next home run.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(336,'2018-12-28','Definiteness of purpose is the starting point of all achievement.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(337,'2018-12-29','Life isn\'t about getting and having, it\'s about giving and being.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(338,'2018-12-30','Life is what happens to you while youre busy making other plans.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26'),(339,'2018-12-31','We become what we think about.',NULL,'2018-12-12 07:11:26','2018-12-12 07:11:26');
